import React from "react";
import ReactDOM from "react-dom";
import './index.css';

// Import chart components
import AreaChart from './Components/AreaChart/AreaChart';
import AreaChartWithYPercent from './Components/AreaChartWithYPercent/AreaChartWithYPercent';
import AreaChartWithZoomPan from './Components/AreaChartWithZoomPan/AreaChartWithZoomPan';
import BarChart from './Components/BarChart/BarChart';
import StackedBarChart from './Components/StackedBarChart/StackedBarChart';
import HorizontalBarChart from './Components/HorizontalBarChart/HorizontalBarChart';
import GroupedBarChart from './Components/GroupedBarChart/GroupedBarChart';
import BubbleChart from './Components/BubbleChart/BubbleChart';
import VolumeProfileChart from './Components/VolumeProfileChart/VolumeProfileChart';
import OHLCChartWithElderRayIndicator from './Components/OHLCChartWithElderRayIndicator/OHLCChartWithElderRayIndicator';
import PointAndFigure from './Components/PointAndFigure/PointAndFigure';
import Renko from './Components/Renko/Renko';
import Kagi from './Components/Kagi/Kagi';
import HeikinAshi from './Components/HeikinAshi/HeikinAshi';
import VolumeProfileBySessionChart from './Components/VolumeProfileBySessionChart/VolumeProfileBySessionChart';

const App = () => {
  return (
    <div>
      <AreaChart />
      <AreaChartWithYPercent />
      <AreaChartWithZoomPan />
      <BarChart />
      <StackedBarChart />
      <HorizontalBarChart />
      <GroupedBarChart />
      <BubbleChart />
      <VolumeProfileChart />
      <OHLCChartWithElderRayIndicator />
      <PointAndFigure />
      <Renko />
      <Kagi />
      <HeikinAshi />
      <VolumeProfileBySessionChart />
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
